import { ApiResponse, Filter } from "../types/models";
import { api_movies } from "../utils";
// import { mapToArray } from "../helpers";

const getItemsTMDB = async({page}: Filter): Promise<ApiResponse> =>{     
        const response = await api_movies.get(`movie/top_rated?page=${page}`);
        return (response.data.results)
    }

export const itemsApi = {getItemsTMDB}
